import "./styles.css";
import MainPageHeader from "./my-image/MainPageHeader.png";

function importALL(relativeLink) {
  let mapDict = {};
  relativeLink.keys().map((item, index) => { mapDict[item.replace('./', '')] = relativeLink(item); });
  return mapDict;
}

const myImage = importALL(require.context('./my-image', false, /\.(png|jpe?g|svg)$/));
const myJson = importALL(require.context('./my-json', false, /\.(json)$/));
const myPython = importALL(require.context('./my-python', false, /\.(py)$/));

export function mainPageImage() {
  return (
    <header>
        <header class="text">
            <h1>SINGAPORE CONDO HUNTING GUIDE</h1>
            <p class="header-mandarin">新加坡公寓购买指南 &nbsp;
                <button class="button">Get Started &nbsp;<a class="mandarin">开始</a></button>
                <br />
            <ul class="vl">
                <li>
                    <a href="CalculateMorgageAndTax.html">Calculate Morgage & Tax After Buy&nbsp; <a
                            href="CalculateMorgageAndTax.html" class="mandarin">计算购房后月供以及税收总和</a></a>
                </li>
            </ul>
            </p>
        </header>
    </header>);
}


export function Footer() {
  return (
    <footer>
      <br />
      <hr />
      <p>
        Powered by Rose
        <br />
        Email:
        <a href="mailto:dululusang@outlook.com">dululusang@outlook.com</a>
      </p>
    </footer>
  );
}
